INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, 2, 24001, 0, 321, 1, 1);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 40011, 2, 24001, 0, 322, 1, 2);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, "プレシア", "んーと。\nこれ、あげる。\nはい", 1, 40011, 2, 24001, 0, 323, 1, 3);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 40011, 2, 24001, 0, 324, 1, 4);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 40011, 2, 24001, 0, 325, 1, 5);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, "プレシア", "お兄。\nきてくれて、うれしい", 2, 40011, 2, 24001, 0, 326, 1, 6);
